current_xkcd:
let
  friday = 1716510000;
  fridayNumber = 2937;
  timeElapsed = (builtins.currentTime - friday);
  weeksSince = timeElapsed / (7 * 24 * 60 * 60);
  extraDays = (lib.mod timeElapsed (7 * 24 * 60 * 60)) / (24 * 60 * 60);
  weekRevisions = if extraDays >= 7 then
    3
  else if extraDays >= 5 then
    2
  else if extraDays >= 3 then
    1
  else
    0;

  currentRevision = fridayNumber + (weeksSince * 3) + weekRevisions;
in currentRevision

